# OEIS sequence: A362060

from sympy import sieve
def ok(n):
    p = sieve[n]
    while n and p:
        if n%10 == p%10:
            n //= 10
        p //= 10
    return n == 0
print([k for k in range(1, 10**6) if ok(k)]) # _Michael S. Branicky_, Apr 06 2023

